import sys


class Solution(object):
    def isCover(self, substr, t):
        # 匹配过的不再被匹配
        matched = []
        for item in t:
            for index, subitem in enumerate(substr):
                print(
                    "t:{}, substr:{},item={}, subitem={},".format(
                        t, substr, item, subitem
                    )
                )
                if item == subitem and index not in matched:
                    print("Success match")
                    matched.append(index)
                    break
                # 表示匹配到最后一个元素了， 还不对， 就表示没有匹配到
                elif index == len(substr) - 1:
                    return False

        if len(matched) == len(t):
            print("substr={}, t={}".format(substr, t))
            return True
        else:
            return False

    def minWindow(self, s, t):
        """
        :type s: str
        :type t: str
        :rtype: str
        """

        left, right = 0, 0
        valid = False
        min_len = 500000
        min_substr = ""
        if len(t) > len(s):
            return min_substr
        while right < len(s):
            # record s[right]
            a = s[right]
            right += 1
            valid = self.isCover(s[left:right], t)
            while valid:
                temp_len = right - left
                if temp_len < min_len:
                    min_len = temp_len
                    min_substr = s[left:right]
                d = s[left]
                left += 1
                valid = self.isCover(s[left:right], t)

        return min_substr

    def run(self):
        r = self.minWindow(
            "",
            "",
        )
        print(r)


mycase = Solution()
mycase.run()
